// src/utils/generatePDF.ts
import jsPDF from "jspdf";
import "jspdf-autotable";

// Use the base64 string of your PNG logo
const logoBase64 =
  "data:image/jpeg;base64,";

const generatePDF = (
  cartItems: any[],
  subtotal: number,
  gst: number,
  deliveryCharges: number,
  totalAmount: number,
  customerDetails: {
    firstName: string;
    lastName: string;
    email: string;
    contact: string;
  },
  orderNumber: number
): Promise<string> => {
  return new Promise((resolve) => {
    const doc = new jsPDF();

    // Add logo on the left
    const logoWidth = 50; // Adjust the width of the logo
    const logoHeight = 20; // Adjust the height of the logo
    doc.addImage(logoBase64, "PNG", 14, 10, logoWidth, logoHeight); // Keep logo aligned to the left

    // Add email and phone below the logo
    doc.setFontSize(12); // Set font size for the contact details
    doc.text("Email: info@circuitxperts.com", 14, 35); // Position the email below the logo
    doc.text("Phone: +91-9235916122", 14, 45); // Position the phone below the email

    // Add order summary title centered
    const title = "Order Summary";
    const pageWidth = doc.internal.pageSize.getWidth();
    const titleWidth = doc.getTextWidth(title);
    const titleX = (pageWidth - titleWidth) / 2; // Calculate center position
    doc.setFontSize(20); // Set font size for the order summary
    doc.text(title, titleX, 60); // Position the title below the contact details, centered

    // Add the current date and time aligned to the left
    const currentDateTime = new Date().toLocaleString(); // Get current date and time in locale format
    doc.setFontSize(12); // Set font size for the date
    doc.text(`Date: ${currentDateTime}`, 14, 70); // Position the date left-aligned

    // Add customer details
    doc.setFontSize(12); // Reset font size for the rest of the document
    doc.text(
      `Customer Name: ${customerDetails.firstName} ${customerDetails.lastName}`,
      14,
      80
    );
    doc.text(`Email: ${customerDetails.email}`, 14, 90);
    doc.text(`Contact: ${customerDetails.contact}`, 14, 100);
    doc.text(`Order Number: ${orderNumber}`, 14, 110);

    // Table for cart items
    const items = cartItems.map((item) => [
      item.name,
      item.price.toFixed(2),
      item.quantity,
      item.totalPrice.toFixed(2),
    ]);
    const columns = ["Product Details", "Price", "Quantity", "Total"];

    (doc as any).autoTable({
      head: [columns],
      body: items,
      startY: 120,
    });

    // Prepare price summary data
    const priceSummary = [
      ["Subtotal", `$${subtotal.toFixed(2)}`],
      ["GST (18%)", `$${gst.toFixed(2)}`],
      ["Delivery Charges", `$${deliveryCharges.toFixed(2)}`],
      ["Total Amount", `$${totalAmount.toFixed(2)}`],
    ];

    // Table for price summary
    const summaryColumns = ["Description", "Amount"];

    const finalY = doc.lastAutoTable.finalY + 5; // Reduce space after items table
    (doc as any).autoTable({
      head: [summaryColumns],
      body: priceSummary,
      startY: finalY,
      didParseCell: (data: {
        row: { index: number };
        cell: { styles: { fontStyle: string } };
      }) => {
        // Make the Total Amount bold
        if (data.row.index === priceSummary.length - 1) {
          data.cell.styles.fontStyle = "bold";
        }
      },
    });

    // Calculate the Y position for the footer to avoid overlap
    const footerStartY = doc.lastAutoTable.finalY + 10; // Start footer 10 units from the last table
    const footerSpacing = 5; // Space between footer lines
    const footerTexts = [
      "Thank you for selecting Koronis Technowing. Please review the attached document for a comprehensive breakdown.",
      "Should you require any modifications or additional details, we are happy to discuss further.",
      "We look forward to your confirmation to proceed.",
      "",
      "If you have any questions, feel free to contact us.",
      "",
      "Sincerely,",
      "Your Trusted Technology Partner",
      "Email: info@circuitxperts.com",
      "Phone: +91-9235916122",
    ];

    // Add footer text
    footerTexts.forEach((text, index) => {
      const footerY = footerStartY + index * footerSpacing;
      doc.text(text, 14, footerY); // Add each line of footer text
    });

    // Save the PDF and resolve the promise
    doc.save(`Order_${orderNumber}.pdf`); // This will prompt a download
    resolve(`Order_${orderNumber}.pdf`); // Resolve with the PDF filename or any relevant info
  });
};

export default generatePDF;
